import  React ,{useState} from 'react';
import TextField from "@material-ui/core/TextField";
import jsPDF from 'jspdf';
import ReactDOMServer from 'react-dom/server';



import './App.css';


function App({a}) {

  const { x2000first } = newValues;

  const calcValue = (a) => {
    const first = document.querySelector(a).value;
    //const second = document.querySelector('#count').value;
    let total = 0;
    total = parseFloat(first) * 2000;
    //total += a.second;
    alert(total);
    return total;
  }


  /*const calcDenomMultiply = (newValues) => {
    const twoThousand = document.querySelector('#x2000').value;
    const second = document.querySelector('#Denomination').value;


alert(newValues.target.elements.cashreceived.value);
alert(newValues.target.elements.Denomination.value);

    alert(twoThousand);

     // const { first,second} = newValues;
  //  const newMultiply = parseInt(first)*parseInt(second);
  //  document.querySelector('.amount').value=parseInt(newMultiply);
    //setMultiply(newMultiply)
    } 


    const calcmultiply = (newValues) => {
    const first = document.querySelector('# denomination').value;
    const second = document.querySelector('#count').value;


alert(newValues.target.elements.cashreceived.value);
alert(newValues.target.elements.Denomination.value);

    alert(first);

     // const { first,second} = newValues;
    const newMultiply = parseInt(first)*parseInt(second);
    document.querySelector('.amount').value=parseInt(newMultiply);
    //setMultiply(newMultiply)
    } 
*/




    const styles = {
      fontFamily: "sans-serif",
      textAlign: "center"
    };
    const colstyle = {
      width: "30%"
    };
    const tableStyle = {
      width: "100%"
    };
    const divStyle = {
      lineheight: "10px"
    };

    const generatePDF = (event) => {




     const Prints = () => (


      <div>

        <table id="tab_customers" class="table table-striped" style={tableStyle}>
          <colgroup>
            <col span="1" style={colstyle} />
            <col span="1" style={colstyle} />
          </colgroup>
          <thead>
            <tr class="warning">
              <th>Cash Received</th>
              <th>Denomination</th>

              <th>Amount</th>

            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{event.target.elements.cashreceived.value}</td>
              <td>{event.target.elements.Denomination.value}</td>

              <td>{event.target.elements.total.value}</td>
            </tr>
          </tbody>
        </table>

      </div>
    );


      // const doc = new jsPDF();

      const string = ReactDOMServer.renderToString(<Prints />);
      const pdf = new jsPDF("p", "mm", "a4");

     // renderToString(<Prints />);
     // doc.fromHTML(ReactDOMServer.renderToString(<Prints />));
    //  doc.save("myDocument.pdf");

      pdf.fromHTML(string);
      pdf.save("mydocument.pdf");
    }


    return(
      <fieldset>

        <div className="form">

          <form onSubmit={generatePDF}>


          <div class="table-title">
        <h3 align="center">DEPOSIT TABLE</h3>
    </div>
    <div align="left">
        <table class="table-fill">
            <thead>
                <tr>
                    <th class="text-left">Denomination</th>
                    <th class="text-left">Count</th>
                    <th class="text-left">Amount</th>
